import React from "react";
import { CurrentWeatherData } from "../types/WeatherTypes";

interface CurrentWeatherProps {
  data: CurrentWeatherData;
}

const CurrentWeather: React.FC<CurrentWeatherProps> = ({ data }) => {
  return (
    <div className="bg-white rounded-lg shadow-md p-4 mb-4 w-full">
      <div className="flex justify-between items-center">
        <h2 className="text-gray-600 font-semibold">CURRENT WEATHER</h2>
        <span className="text-gray-500 text-sm">{data.time}</span>
      </div>
      <div className="mt-2 flex">
        <div className="flex-1">
          <div className="flex items-center">
            <i className={`${data.icon} text-6xl text-yellow-500 mr-4`}></i>
            <div>
              <span className="text-5xl font-bold">{data.temp}</span>
            </div>
          </div>
          <div className="text-gray-500">RealFeelÂ® {data.feelsLike}</div>
          <div className="text-gray-800 font-semibold mt-2">{data.condition}</div>
        </div>
        <div className="flex-1 text-right">
          <div className="text-gray-600">Humidity</div>
          <div className="text-gray-800 font-semibold">{data.humidity}</div>
          <div className="text-gray-600 mt-2">Wind</div>
          <div className="text-gray-800 font-semibold">{data.wind}</div>
        </div>
      </div>
    </div>
  );
};

export default CurrentWeather;
